import React, { Component } from 'react';
import Navbar from './Navbar'
import ReactToPrint from "react-to-print";
import TableThuHS from './TableThuHS.js';
import Trangchu from './Trangchu.js';
import GiayTo from './GiayTo.js';

import Dangnhap from './Dangnhap.js';
class XuatFile extends Component {
    render() {
    	 if(localStorage.getItem("User")!=null)

        return (
            <GiayTo />
        );
    else return(<Dangnhap />);
    }
}

export default XuatFile;
